import React from 'react';
import axios from 'axios';

function GetAllAccounts() {
    axios.get('http://localhost:8080/accounts/')
        .then(res=> {
            return(
                <ul>
                    {res.data.map(user =>(
                        <li>
                            name: {user.firstname}, 
                        </li>
                    ))}
                </ul>
            )
        }).catch(err => {
        console.log(err)
    })
}

export default GetAllAccounts;
